import React from 'react';
import Head from 'next/head'

class ArticleBox extends React.Component {
    render () {
        return (
            <div>
                <Head>
                    <link rel="stylesheet" href="C:\components\article-details.css" />
                </Head>
                <div>
                    <p>hey</p>
                </div>
            </div>
        )
    }
}
export default ArticleBox;
